import cRequest from '../index'
class loginRequest {
    accountLoginAccount() {
        return cRequest.getRequest({
            url: "/1/classes/tb_user",
            params: '"username":"caicai","password":"123456"}&groupcount=true&sum=username'
        }).data;
    }
}
export default new loginRequest();
